import { useImmer } from "use-immer"
import TextField from '@material-ui/core/TextField';



const Search = (props) => {
    const [state, setState] = useImmer({
        searchTerm: "",
        results: [],
        show: "neither",
        requestCount: 0,
    })

    return (
        <div>
            <form className={`flex-center`} noValidate autoComplete="on">

                <div>
                    <TextField
                        /*error*/
                        id="outlined-error"
                        label="Error"
                        defaultValue="Hello Worl"
                        variant="outlined"
                    />
                    <TextField
                        /*error*/
                        id="outlined-error-helper-text"
                        label="Error"
                        defaultValue="Hello World"
                        helperText="Incorrect entry."
                        variant="outlined"
                    />
                </div>
            </form>

            <style jsx>{`
                 .flex-center{
                    display: flex;
                    justify-content: center;
                    margin: 100px 0;
                 }
               
            `}
            </style>
        </div>

    );

};
export default Search;
